css:
.serverless-dashboard {
  position: relative;
  display: flex;
  flex-direction: column;
}
.serverless-dashboard h1 {
  font-size: 2em;
  margin: 0 0 .5em 0;
  color: #fff;
}
.serverless-dashboard a {
  text-decoration: underline;
}
.serverless-dashboard .serverless-dashboard-header {
  padding: 15px;
  border-bottom: 1px solid rgba(0, 0, 0, 0.5);
}
.serverless-dashboard .serverless-dashboard-header h1 {
  font-size: 2em;
  margin: 0 0 .5em 0;
  color: #fff;
}
.serverless-dashboard .serverless-dashboard-header p {
  font-size: 1.2em;
}
.serverless-dashboard .serverless-dashboard-header p:last-of-type {
  margin-bottom: 0;
}
.serverless-dashboard .serverless-dashboard-sections {
  flex: 1;
  overflow: auto;
  flex-wrap: wrap;
  padding: 15px 15px 0 15px;
}
.serverless-dashboard .serverless-dashboard-sections > section {
  background-color: #242729;
  padding: 0;
  border-bottom: 1px solid rgba(0, 0, 0, 0.5);
  border-top: none;
}
.serverless-dashboard .serverless-dashboard-sections > section:last-child {
  margin-bottom: 0;
}
.serverless-dashboard .serverless-dashboard-sections > section.collapsed {
  background-color: #292c2f;
}
.serverless-dashboard .serverless-dashboard-sections > section.collapsed > .section-heading {
  display: block;
  margin: 0;
  padding-bottom: 15px;
  color: #aaa;
}
.serverless-dashboard .serverless-dashboard-sections > section.collapsed > .section-heading:hover {
  color: #fff;
  background-color: rgba(255, 255, 255, 0.07);
}
.serverless-dashboard .serverless-dashboard-sections > section.collapsed > .section-heading:active {
  background-color: #292c2f;
}
.serverless-dashboard .serverless-dashboard-sections > section.collapsed > * {
  display: none;
}
.serverless-dashboard .serverless-dashboard-sections .header-operations {
  display: flex;
}
.serverless-dashboard .serverless-dashboard-sections .header-operations .btn {
  margin-left: 10px;
}
.serverless-dashboard .serverless-dashboard-sections .section-heading {
  display: flex;
  margin-right: auto;
}
.serverless-dashboard .serverless-dashboard-sections .section-heading .section-heading-title {
  font-weight: normal;
  font-size: 1.8em;
  color: #fff;
}
.serverless-dashboard .serverless-dashboard-sections .setting-title {
  display: flex;
}
.serverless-dashboard .serverless-dashboard-sections .setting-title .input-text {
  margin: 0 10px;
}
.serverless-dashboard .serverless-dashboard-sections .control-group {
  margin-top: 30px;
}
.serverless-dashboard .serverless-dashboard-sections .control-group-region {
  position: relative;
  width: 100%;
}
.serverless-dashboard .serverless-dashboard-sections .control-group-region .controls-region {
  position: absolute;
  bottom: 0;
  width: 100%;
}
.serverless-dashboard .serverless-dashboard-sections .env-picker {
  display: flex;
  flex-wrap: wrap;
  margin: 0 -10px;
}
.serverless-dashboard .serverless-dashboard-sections .env-picker-item {
  flex: 1;
  min-width: 320px;
  padding: 0 10px;
}
.serverless-dashboard .serverless-dashboard-sections select.form-control {
  color: #aaa;
  border-color: rgba(0, 0, 0, 0.5);
  background-color: #43484d;
}
.serverless-dashboard .serverless-dashboard-sections select.form-control:hover,
.serverless-dashboard .serverless-dashboard-sections select.form-control:focus {
  box-shadow: none;
  background-color: #4f555b;
}
.serverless-dashboard .serverless-dashboard-sections .select-container {
  display: flex;
  align-items: stretch;
}
.serverless-dashboard .serverless-dashboard-sections .operation-block {
  display: flex;
  flex-wrap: wrap;
  border-radius: 2px;
  padding: 5px;
}
.serverless-dashboard .serverless-dashboard-sections .operation-block .control-group {
  position: relative;
  flex: 1 1 300px;
}
.serverless-dashboard .serverless-dashboard-sections .operation-block .control-group .control-content {
  min-width: 0;
  margin: 5px;
  border-radius: 2px;
  border: 1px solid rgba(0, 0, 0, 0.5);
  padding: 10px;
  background: #292c2f;
  overflow: hidden;
}
.serverless-dashboard .serverless-dashboard-sections .operation-block .functions-block .function-header {
  display: flex;
}
.serverless-dashboard .serverless-dashboard-sections .operation-block .functions-block .function-header .apply-block {
  margin-left: auto;
}
.serverless-dashboard .serverless-dashboard-sections .console-block .console-content {
  font-family: Menlo, "Deja Vu Sans Mono", Consolas, monospace;
  min-width: 0;
  margin: 5px;
  border-radius: 2px;
  border: 1px solid rgba(0, 0, 0, 0.5);
  padding: 10px;
  overflow: hidden;
  background: #000000;
  color: #00af00;
}
